import React from 'react'
import {
    FeaturesContainer,
    FeaturesButton
} from './FeaturesElements'

const Features = () => {
  return (
    <FeaturesContainer>
      <h1>Ambienta tu fiesta</h1>
      <p>Cotiza diferentes cantidades de neon flex por color</p>
      <FeaturesButton>Cotiza ahora</FeaturesButton>
    </FeaturesContainer>
  )
}

export default Features
